import React from 'react';
import { BrowserRoute, Route, Switch } from 'react-router-dom';
import StorePicker from './store-picker';

const Router = () => (
  <BrowserRoute>
    <Switch>
      <Route exact path="/" component={StorePicker} />
    </Switch>
  </BrowserRoute>
)
